import { NavLink } from 'react-router-dom';

function Nav(){
return (
    <nav>
    <ul>
        <li><NavLink to="/">Home</NavLink></li>
        <li><NavLink to="/cadastroLivros">Cadastros</NavLink></li>
        <li><NavLink to="/cadastroLeitores">Cadastros</NavLink></li>
    </ul>
    </nav>
  );
}

export default Nav;
